// JavaScript Document
import React from 'react';

//Material UI
import Typography from '@material-ui/core/Typography';
import Link from '@material-ui/core/Link';
import Grid from "@material-ui/core/Grid";


//Smart Component
class StateActivities extends React.Component {
	//declaring state and new object
	state ={
		activityListing:[]
	}

//calling fetchData function
	componentDidMount(){
		this.fetchActivities();
}

//fetching API
fetchActivities(){
// fetch('https://developer.nps.gov/api/v1/activities?statecode=FL&api_key=YpbDDtsNwQRi13JXZXiN7DnEIusWnKQLsCZW11xq')

	fetch('https://developer.nps.gov/api/v1/parks?parkCode=bepa&api_key=YpbDDtsNwQRi13JXZXiN7DnEIusWnKQLsCZW11xq')
		.then(results =>{
		return results.json();
	}).then(data =>{

		let mList = data.data.map((use, i)=>{
			return(
				<Grid container key={i} style={styles.container}>

					<Grid item xs={12} style={styles.indentRight}>
		  				<h2>Park Activities</h2>

	  					<Grid item xs={11} style={styles.activities}>
							<ul>
							{use.activities.map(activity =>{
							return(
							<li key={activity} style={{backgroundColor: 'rgb(15,15,15,0.5)'}}>{activity.name}</li>	
							)})}
							</ul>
	  					</Grid>
	   				</Grid> 	
				</Grid>  	
			)
		})

		this.setState({StateActivities:mList});
	})
}
	 render() { 
  return (
	  <div>
	  {this.state.StateActivities}		
	  </div>
  );
 }
}
export default StateActivities

const styles ={
	container:{
		marginTop:'1%',
		border:'1px solid green',
	},
}
